ENTERGY SERVICES, INC. Rate Schedule 435-E
SERVICE AGREEMENT FOR GENERATION PLANNING AND OPERATIONAL SUPPORT SERVICES
THIS SERVICE AGREEMENT (“Service Agreement”), made and entered into by and between Entergy Services, Inc. (hereinafter referred to as “Entergy Services”), a corporation organized under the laws of the State of Delaware with its principal place of business at 639 Loyola Avenue, New Orleans, Louisiana 70113, and Entergy Mississippi, Inc. (hereinafter referred to as “EMI”), a corporation organized under the laws of the State of Mississippi with its principal place of business at 308 East Pearl Street, Jackson, Mississippi 39205. WITNESSETH THAT: WHEREAS, in 1963, the Securities and Exchange Commission entered an order under the Public Utility Holding Company Act of 1935 authorizing the organization and conduct of business of Entergy Services, a wholly-owned subsidiary of Entergy Corporation (hereinafter referred to as Entergy); WHEREAS, Entergy Services is organized, staffed and equipped to render services as herein provided to EMI; WHEREAS, economies and increased efficiencies will result from the performance by Entergy Services of certain services for EMI; WHEREAS, Entergy Services is willing to render such services at cost, determined in accordance with applicable rules and regulations of the Federal Energy Regulatory Commission (hereinafter referred to as the “Commission”) under the Federal Power Act, as amended by the Public Utility Holding Company Act of 2005, except that there will be no charge for the use of the initial equity capital of Entergy Services amounting to $20,000; WHEREAS, EMI desires to have Entergy Services perform certain planning, operations, fuel supply, and other technical support services for EMI; WHEREAS, Entergy Services currently provides administrative and support services to EMI under a service agreement that conforms with a form of service agreement on file with the Commission as Entergy Services’ Rate Schedule 435-A; generation planning and operational support services to EMI under a service agreement that conforms with Rate Schedule 435-E; and transmission planning and reliability support services to EMI under a service agreement that conforms with Rate Schedule 435-F; WHEREAS, effective September 1, 2016, Entergy Services will continue to provide administrative and support services to EMI under a service agreement that conforms with Rate Schedule 435-A; generation planning and operational support services to EMI under a service agreement that conforms with this Rate Schedule 435-E; and transmission planning and reliability support services to EMI under a service agreement that conforms with Rate Schedule 435-F; WHEREAS, EMI and Entergy Services seek to clarify further the roles and responsibilities of EMI and Entergy Services in conducting EMI’s operations, and to provide greater assurance that the services identified herein are provided pursuant to and/or in accordance with the directives provided by EMI to Entergy Services in connection with these services and that there are no joint generation or resource planning or any coordination or optimization regarding generation or resource planning between EMI and any of the other public utility operating companies of Entergy (“Operating Companies”); and WHEREAS, Entergy Services has agreed to provide such support services to EMI under EMI’s direction on the terms and conditions provided herein. NOW, THEREFORE, in consideration of the premises and of the mutual agreements herein, the parties hereto agree as follows: I. AGREEMENT TO FURNISH SERVICES Entergy Services agrees to furnish to EMI, upon the terms and conditions hereinafter set forth, such of the services described in Exhibit I hereto at such times, for such periods and in such manner as EMI may from time to time request Entergy Services to provide. Entergy Services will, as and to the extent required for EMI, keep itself and its personnel available and competent to render such services to EMI. Entergy Services will also provide EMI such services not described in Exhibit I as EMI may request and which Entergy Services is competent to perform. In supplying services provided for under this Service Agreement, Entergy Services may arrange for the services of technical advisers, engineers, and other service providers, whether employed by Entergy Services or an associate company or through a third party, with the necessary qualifications and experience as are required for or pertinent to the rendition of such services. In general, Entergy Services will conduct the activities under this Service Agreement in a coordinated fashion with EMI staff, and the services provided hereunder will be provided by Entergy Services consistent with policies established by the EMI Operating Committee. Entergy Services will communicate with EMI staff on a timely basis regarding relevant issues. II. AGREEMENT TO TAKE SERVICES EMI agrees to take from Entergy Services such of the services described in Exhibit I as EMI requests. III. ANNUAL REVIEW OF SERVICES On an annual basis, EMI shall review with Entergy Services this Service Agreement to determine if modifications to this Service Agreement are needed prior to the upcoming year. The review will be conducted prior to September 1 of each year. If modifications are determined to be needed, then Entergy Services shall cooperate in making such modifications. IV. COMPENSATION As compensation for services rendered to it by Entergy Services, EMI hereby agrees to pay to Entergy Services the cost of such services. Intercompany payables for the amount of such costs will be recorded by EMI on or before the closing of the books in the succeeding month and will be funded on or before the 25th day of such month. The methods for the determination of the cost of services to be paid by EMI are set forth in Exhibit II hereto. V. TERM OF AGREEMENT This Service Agreement shall become effective as of September 1, 2016, and shall continue until terminated as of the end of any calendar year by either party giving to the other at least 60 days written notice of its intention so to terminate. IN WITNESS WHEREOF, the parties hereto have caused this Service Agreement to be executed as of the ____ day of ________, (year). ENTERGY SERVICES, INC.
