EXHIBIT I SERVICES 1. Forecasting and technical support for integrated resource planning and operations;
2. Technical support for EMI’s transmission service arrangements, including support for the evaluation of potential economic transmission upgrades to reduce production costs for EMI and for evaluation of transmission upgrades;
3. Providing Local Balancing Authority, meter data management, and meter data quality services;
4. Arranging for non-nuclear fuel supplies;
5. Technical support for generation resource procurement;
6. Real-time operations for EMI’s generation fleet, and operating plans, including planned and maintenance outages for EMI’s generation fleet;
7. Buying and selling capacity and energy on behalf of EMI, including providing administration services for contractual arrangements, and power supply accounting and settlements for power and energy;
8. Representing EMI in industry and stakeholder committees;
9. Performing regulatory, compliance, and litigation support services in connection with the services provided under the Service Agreement; and
10. Performing such other and different services as EMI may request in support of its generation planning, operational support, dispatch, and purchased power procurement activities.
EXHIBIT II
COST ALLOCATIONS
1. Entergy Services will account for and bill to EMI its expenses that are directly attributable to the services Entergy Services renders to EMI. 2. Entergy Services will account for and bill to EMI an appropriate portion of the cost of overheads incurred in providing services to EMI. 3. The costs of rendering service by Entergy Services will include all costs of doing business including interest on debt. 4. a. Entergy Services will maintain a separate record of the expenses of each department. The expenses of each department will include: i. those expenses that are directly attributable to such department; ii. an appropriate portion of those indirect expenses of Entergy Services that are not directly attributable to a specific department but which are necessary to the operation of such department; and iii. an appropriate portion of those expenses of other Entergy Services departments necessary to support the operation of the department. b. Expenses of a department will include salaries and wages of employees, including social security taxes, vacations, paid absences, sickness, employee disability expenses, and other employee welfare expenses, rent and utilities, desktops, information technology and communications equipment and systems, material and supplies, and all other expenses attributable to the department. c. Departmental expense will be categorized into one of three classes: i. those expenses which are directly attributable to specific services rendered to EMI (Departmental Direct Costs); ii. those indirect expenses which are attributable to the overall operation of the department and not to a specific service provided (Departmental Indirect Costs) (these expenses include not only the salaries and wages of employees, but also other related employment costs described in Section 4(b) above); and iii. those expenses which are attributable to the operation of other departments of Entergy Services as well as to a specific service provided (Departmental Support Service Costs). d. The indirect expenses of the department will not include: i. those incremental out-of-pocket expenses that are incurred for the direct benefit and convenience of EMI or another Operating Company and therefore are to be directly charged to EMI or another Operating Company; and ii. Entergy Services’ overhead expenses that are attributable to maintaining the corporate existence of Entergy Services, franchise and other general taxes, and all other incidental overhead expenses including those auditing fees and accounting department expenses attributable to Entergy Services (Indirect Corporate Costs). e. Entergy Services will establish annual budgets for controlling the expenses of each service department and those expenses identified in Section 4(d), which are not department specific. 5. Employees in each department will maintain a record of the time they are employed in rendering service to EMI. The hourly rate for each employee will be determined each pay period. 6. a. The charge to EMI for a particular service will be the sum of the figures derived by multiplying the hours reported by each employee in rendering such service by the hourly rate applicable to such employee and other direct expenses. b. Departmental Indirect Costs as defined in 4(c)(ii) will be loaded onto project codes in proportion to the direct salaries and wages charged to all project codes. c. Departmental Support Service Costs as defined in 4(c)(iii) will be allocated to EMI using consumption-based billing methods, with these costs then distributed by function. Any costs that remain at Entergy Services after this initial billing will be loaded onto project codes in proportion to the direct salaries and wages charged to all project codes. 7. Those expenses of Entergy Services that are not included in the expenses of a department under Section 4 above will be charged to EMI as follows: a. Incremental out-of-pocket costs incurred for the direct benefit and convenience of EMI will be charged directly to EMI. b. The Indirect Corporate Costs of Entergy Services referred to above in Section 4 (d)(ii) will be allocated to EMI in the same proportion as all charges billed by Entergy Services to EMI, excluding Indirect Corporate Costs. c. If the method of allocation of Departmental Indirect Costs (Section 6(b)), Departmental Support Service Costs (Section 6(c)), or Indirect Corporate Costs (Section 7(b)), would result in an inequity because of a change in operations or organization of any client that takes services form Entergy Services, then Services may adjust the basis to effect an equitable distribution. Any such change in allocation shall be made only after first giving the Commission written notice of such proposed change not less than 60 days prior to the proposed effectiveness of any such change. 8. On the basis of the foregoing, intercompany billings will be recorded by EMI. Intercompany billing procedures and amounts will be open to audit by EMI and by any regulatory authority having jurisdiction over EMI. 9. Entergy Services will ensure that when EMI takes services under more than one service agreement under Rate Schedules 435-A, 435-E, or 435-F, it will not be allocated duplicative costs in connection with the services it receives under those service agreements.

EXHIBIT I

			  SERVICES

			  Entergy Services will provide some or all of the following services at the direction of EAI:

			  1.	Technical and engineering support for EAI’s transmission planning functions or other transmission-related requirements as required by applicable tariff and business practice requirements;

			  2.	Technical and engineering support to support EAI’s performance of transmission planning responsibilities as required by North American Electric Reliability Corporation (“NERC”) or its successor pursuant to applicable planning related Reliability Standards or other applicable NERC requirements.  ESI will act as agent for EAI with respect to EAI’s obligations as a Transmission Planner or analogous role pursuant to NERC requirements;
			  3.	Representation of EAI in industry groups and industrial technical committees in connection with transmission planning;

			  4.	Maintenance of computer systems, analysis tools, applications, documents, data, and other records necessary to perform the engineering assessments and analysis according to established requirements;

			  5.	Regulatory, compliance, and litigation support services in connection with the services provided under the Service Agreement; and

			  6.	Such other and different services as EAI may request in support of its transmission planning and reliability activities.

