10. Performing such other and different services as ETI may request in support of its generation planning, operational support, dispatch, and purchased power procurement activities.
EXHIBIT II
COST ALLOCATIONS
1. Entergy Services will account for and bill to ETI its expenses that are directly attributable to the services Entergy Services renders to ETI. 2. Entergy Services will account for and bill to ETI an appropriate portion of the cost of overheads incurred in providing services to ETI. 3. The costs of rendering service by Entergy Services will include all costs of doing business including interest on debt. 4. a. Entergy Services will maintain a separate record of the expenses of each department. The expenses of each department will include: i. those expenses that are directly attributable to such department; ii. an appropriate portion of those indirect expenses of Entergy Services that are not directly attributable to a specific department but which are necessary to the operation of such department; and iii. an appropriate portion of those expenses of other Entergy Services departments necessary to support the operation of the department. b. Expenses of a department will include salaries and wages of employees, including social security taxes, vacations, paid absences, sickness, employee disability expenses, and other employee welfare expenses, rent and utilities, desktops, information technology and communications equipment and systems, material and supplies, and all other expenses attributable to the department. c. Departmental expense will be categorized into one of three classes: i. those expenses which are directly attributable to specific services rendered to ETI (Departmental Direct Costs); ii. those indirect expenses which are attributable to the overall operation of the department and not to a specific service provided (Departmental Indirect Costs) (these expenses include not only the salaries and wages of employees, but also other related employment costs described in Section 4(b) above); and iii. those expenses which are attributable to the operation of other departments of Entergy Services as well as to a specific service provided (Departmental Support Service Costs). d. The indirect expenses of the department will not include: i. those incremental out-of-pocket expenses that are incurred for the direct benefit and convenience of ETI or another Operating Company and therefore are to be directly charged to ETI or another Operating Company; and ii. Entergy Services’ overhead expenses that are attributable to maintaining the corporate existence of Entergy Services, franchise and other general taxes, and all other incidental overhead expenses including those auditing fees and accounting department expenses attributable to Entergy Services (Indirect Corporate Costs). e. Entergy Services will establish annual budgets for controlling the expenses of each service department and those expenses identified in Section 4(d), which are not department specific. 5. Employees in each department will maintain a record of the time they are employed in rendering service to ETI. The hourly rate for each employee will be determined each pay period. 6. a. The charge to ETI for a particular service will be the sum of the figures derived by multiplying the hours reported by each employee in rendering such service by the hourly rate applicable to such employee and other direct expenses. b. Departmental Indirect Costs as defined in 4(c)(ii) will be loaded onto project codes in proportion to the direct salaries and wages charged to all project codes. c. Departmental Support Service Costs as defined in 4(c)(iii) will be allocated to ETI using consumption-based billing methods, with these costs then distributed by function. Any costs that remain at Entergy Services after this initial billing will be loaded onto project codes in proportion to the direct salaries and wages charged to all project codes. 7. Those expenses of Entergy Services that are not included in the expenses of a department under Section 4 above will be charged to ETI as follows: a. Incremental out-of-pocket costs incurred for the direct benefit and convenience of ETI will be charged directly to ETI. b. The Indirect Corporate Costs of Entergy Services referred to above in Section 4 (d)(ii) will be allocated to ETI in the same proportion as all charges billed by Entergy Services to ETI, excluding Indirect Corporate Costs. c. If the method of allocation of Departmental Indirect Costs (Section 6(b)), Departmental Support Service Costs (Section 6(c)), or Indirect Corporate Costs (Section 7(b)), would result in an inequity because of a change in operations or organization of any client that takes services form Entergy Services, then Entergy Services may adjust the basis to effect an equitable distribution. Any such change in allocation shall be made only after first giving the Commission written notice of such proposed change not less than 60 days prior to the proposed effectiveness of any such change. 8. On the basis of the foregoing, intercompany billings will be recorded by ETI. Intercompany billing procedures and amounts will be open to audit by ETI and by any regulatory authority having jurisdiction over ETI. 9. Entergy Services will ensure that when ETI takes services under more than one service agreement under Rate Schedules 435-A, 435-G, or 435-H, it will not be allocated duplicative costs in connection with the services it receives under those service agreements.

