rvice Costs). d. The indirect expenses of the department will not include: i. those incremental out-of-pocket expenses that are incurred for the direct benefit and convenience of ENO or another Operating Company and therefore are to be directly charged to ENO or another Operating Company; and ii. Entergy Services’ overhead expenses that are attributable to maintaining the corporate existence of Entergy Services, franchise and other general taxes, and all other incidental overhead expenses including those auditing fees and accounting department expenses attributable to Entergy Services (Indirect Corporate Costs). e. Entergy Services will establish annual budgets for controlling the expenses of each service department and those expenses identified in Section 4(d), which are not department specific. 5. Employees in each department will maintain a record of the time they are employed in rendering service to ENO. The hourly rate for each employee will be determined each pay period. 6. a. The charge to ENO for a particular service will be the sum of the figures derived by multiplying the hours reported by each employee in rendering such service by the hourly rate applicable to such employee and other direct expenses. b. Departmental Indirect Costs as defined in 4(c)(ii) will be loaded onto project codes in proportion to the direct salaries and wages charged to all project codes. c. Departmental Support Service Costs as defined in 4(c)(iii) will be allocated to ENO using consumption-based billing methods, with these costs then distributed by function. Any costs that remain at Entergy Services after this initial billing will be loaded onto project codes in proportion to the direct salaries and wages charged to all project codes. 7. Those expenses of Entergy Services that are not included in the expenses of a department under Section 4 above will be charged to ENO as follows: a. Incremental out-of-pocket costs incurred for the direct benefit and convenience of ENO will be charged directly to ENO. b. The Indirect Corporate Costs of Entergy Services referred to above in Section 4 (d)(ii) will be allocated to ENO in the same proportion as all charges billed by Entergy Services to ENO, excluding Indirect Corporate Costs. c. If the method of allocation of Departmental Indirect Costs (Section 6(b)), Departmental Support Service Costs (Section 6(c)), or Indirect Corporate Costs (Section 7(b)), would result in an inequity because of a change in operations or organization of any client that takes services form Entergy Services, then Entergy Services may adjust the basis to effect an equitable distribution. Any such change in allocation shall be made only after first giving the Commission written notice of such proposed change not less than 60 days prior to the proposed effectiveness of any such change. 8. On the basis of the foregoing, intercompany billings will be recorded by ENO. Intercompany billing procedures and amounts will be open to audit by ENO and by any regulatory authority having jurisdiction over ENO. 9. Entergy Services will ensure that when ENO takes services under more than one service agreement under Rate Schedules 435-A, 435-K, or 435-L, it will not be allocated duplicative costs in connection with the services it receives under those service agreements.

