 conforms with Rate Schedule 435-C; and transmission planning and reliability support services to EAI under a service agreement that conforms with Rate Schedule 435-D; WHEREAS, effective September 1, 2016, Entergy Services will continue to provide administrative and support services to EAI under a service agreement that conforms with Rate Schedule 435-A; generation planning and operational support services to EAI under a service agreement that conforms with this Rate Schedule 435-C; and transmission planning and reliability support services to EAI under a service agreement that conforms with Rate Schedule 435-D; WHEREAS, EAI and Entergy Services seek to clarify further the roles and responsibilities of EAI and Entergy Services in conducting EAI’s operations, and to provide greater assurance that the services identified herein are provided pursuant to and/or in accordance with the directives provided by EAI to Entergy Services in connection with these services and that there are no joint generation or resource planning or any coordination or optimization regarding generation or resource planning between EAI and any of the other public utility operating companies of Entergy (“Operating Companies”); and WHEREAS, Entergy Services has agreed to provide such support services to EAI under its direction on the terms and conditions provided herein. NOW, THEREFORE, in consideration of the premises and of the mutual agreements herein, the parties hereto agree as follows: I. AGREEMENT TO FURNISH SERVICES Entergy Services agrees to furnish to EAI, upon the terms and conditions hereinafter set forth, such of the services described in Exhibit I hereto at such times, for such periods and in such manner as EAI may from time to time request Entergy Services to provide. Entergy Services will, as and to the extent required for EAI, keep itself and its personnel available and competent to render such services to EAI. Entergy Services will also provide EAI such services not described in Exhibit I as EAI may request and which Entergy Services is competent to perform. In supplying services provided for under this Service Agreement, Entergy Services may arrange for the services of such technical advisers, engineers, and other service providers, whether employed by Entergy Services or an associate company or through a third party with the necessary qualifications and experience as are required for or pertinent to the rendition of such services. II. AGREEMENT TO TAKE SERVICES EAI agrees to take from Entergy Services such of the services described in Exhibit I as EAI requests. III. ANNUAL REVIEW OF SERVICES On an annual basis, EAI shall review with Entergy Services this Service Agreement to determine if modifications to this Service Agreement are needed prior to the upcoming year. The review will be conducted prior to September 1 of each year. If modifications are determined to be needed, then Entergy Services shall cooperate in making such modifications. IV. COMPENSATION As compensation for services rendered to it by Entergy Services, EAI hereby agrees to pay to Entergy Services the cost of such services. Intercompany payables for the amount of such costs will be recorded by EAI on or before the closing of the books in the succeeding month and will be funded on or before the 25th day of such month. The methods for the determination of the cost of services to be paid by EAI are set forth in Exhibit II hereto. V. TERM OF AGREEMENT This Service Agreement shall become effective as of September 1, 2016, and shall continue until terminated as of the end of any calendar year by either party giving to the other at least 60 days written notice of its intention so to terminate. IN WITNESS WHEREOF, the parties hereto have caused this Service Agreement to be executed as of the ____ day of ________, (year).
