rvice Costs). d. The indirect expenses of the department will not include: i. those incremental out-of-pocket expenses that are incurred for the direct benefit and convenience of EMI or another Operating Company and therefore are to be directly charged to EMI or another Operating Company; and ii. Entergy Services’ overhead expenses that are attributable to maintaining the corporate existence of Entergy Services, franchise and other general taxes, and all other incidental overhead expenses including those auditing fees and accounting department expenses attributable to Entergy Services (Indirect Corporate Costs). e. Entergy Services will establish annual budgets for controlling the expenses of each service department and those expenses identified in Section 4(d), which are not department specific. 5. Employees in each department will maintain a record of the time they are employed in rendering service to EMI. The hourly rate for each employee will be determined each pay period. 6. a. The charge to EMI for a particular service will be the sum of the figures derived by multiplying the hours reported by each employee in rendering such service by the hourly rate applicable to such employee and other direct expenses. b. Departmental Indirect Costs as defined in 4(c)(ii) will be loaded onto project codes in proportion to the direct salaries and wages charged to all project codes. c. Departmental Support Service Costs as defined in 4(c)(iii) will be allocated to EMI using consumption-based billing methods, with these costs then distributed by function. Any costs that remain at Entergy Services after this initial billing will be loaded onto project codes in proportion to the direct salaries and wages charged to all project codes. 7. Those expenses of Entergy Services that are not included in the expenses of a department under Section 4 above will be charged to EMI as follows: a. Incremental out-of-pocket costs incurred for the direct benefit and convenience of EMI will be charged directly to EMI. b. The Indirect Corporate Costs of Entergy Services referred to above in Section 4 (d)(ii) will be allocated to EMI in the same proportion as all charges billed by Entergy Services to EMI, excluding Indirect Corporate Costs. c. If the method of allocation of Departmental Indirect Costs (Section 6(b)), Departmental Support Service Costs (Section 6(c)), or Indirect Corporate Costs (Section 7(b)), would result in an inequity because of a change in operations or organization of any client that takes services form Entergy Services, then Services may adjust the basis to effect an equitable distribution. Any such change in allocation shall be made only after first giving the Commission written notice of such proposed change not less than 60 days prior to the proposed effectiveness of any such change. 8. On the basis of the foregoing, intercompany billings will be recorded by EMI. Intercompany billing procedures and amounts will be open to audit by EMI and by any regulatory authority having jurisdiction over EMI. 9. Entergy Services will ensure that when EMI takes services under more than one service agreement under Rate Schedules 435-A, 435-E, or 435-F, it will not be allocated duplicative costs in connection with the services it receives under those service agreements.

ENTERGY SERVICES, LLC Rate Schedule 435-N
SERVICE AGREEMENT FOR GENERATION PLANNING AND OPERATIONAL SUPPORT SERVICES
THIS SERVICE AGREEMENT (“Service Agreement”), made and entered into by and between Entergy Services, LLC (hereinafter referred to as “Entergy Services”), a limited liability company organized under the laws of the State of Louisiana with its principal place of business at 639 Loyola Avenue, New Orleans, Louisiana 70113, and [__________________] (hereinafter referred to as “[Client Company]”), a corporation organized under the laws of the State of [__________] with its principal place of business at [___________________________________]. WITNESSETH THAT: WHEREAS, in 1963, the Securities and Exchange Commission entered an order under the Public Utility Holding Company Act of 1935 authorizing the organization and conduct of business of Entergy Services, a wholly-owned subsidiary of Entergy Corporation (hereinafter referred to as Entergy); WHEREAS, Entergy Services is organized, staffed and equipped to render services as herein provided to [Client Company]; WHEREAS, economies and increased efficiencies will result from the performance by Entergy Services of certain services for [Client Company]; WHEREAS, Entergy Services is willing to render such services at cost, determined in accordance with applicable rules and regulations of the Federal Energy Regulatory Commission (hereinafter referred to as the “Commission”) under the Federal Power Act, as amended by the Public Utility Holding Company Act of 2005, except that there will be no charge for the use of the initial equity capital of Entergy Services amounting to $20,000; WHEREAS, [Client Company] desires to have Entergy Services perform certain planning, operations, fuel supply, and other technical support services for [Client Company]’s generation fleet; WHEREAS, Entergy Services has agreed to provide such support services to [Client Company] under its direction on the terms and conditions provided herein. NOW, THEREFORE, in consideration of the premises and of the mutual agreements herein, the parties hereto agree as follows: I. AGREEMENT TO FURNISH SERVICES Entergy Services agrees to furnish to [Client Company], upon the terms and conditions hereinafter set forth, such of the services described in Exhibit I hereto at such times, for such periods and in such manner as [Client Company] may from time to time request Entergy Services to provide. Entergy Services will, as and to the extent required for [Client Company], keep itself and its personnel available and competent to render such services to [Client Company]. Entergy Services will also provide [Client Company] such services not described in Exhibit I as [Client Company] may request and which Entergy Services is competent to perform. In supplying services provided for under this Service Agreement, Entergy Services may arrange for the services of such technical advisers, engineers, and other service providers, whether employed by Entergy Services or an associate company or through a third party with the necessary qualifications and experience as are required for or pertinent to the rendition of such services. II. AGREEMENT TO TAKE SERVICES [Client Company] agrees to take from Entergy Services such of the services described in Exhibit I as [Client Company] requests. III. ANNUAL REVIEW OF SERVICES On an annual basis, [Client Company] shall review with Entergy Services this Service Agreement to determine if modifications to this Service Agreement are needed prior to the upcoming year. The review will be conducted prior to September 1 of each year. If modifications are determined to be needed, then Entergy Services shall cooperate in making such modifications. IV. COMPENSATION As compensation for services rendered to it by Entergy Services, [Client Company] hereby agrees to pay to Entergy Services the cost of such services. Intercompany payables for the amount of such costs will be recorded by [Client Company] on or before the closing of the books in the succeeding month and will be funded on or before the 25th day of such month. The methods for the determination of the cost of services to be paid by [Client Company] are set forth in Exhibit II hereto. V. TERM OF AGREEMENT This Service Agreement shall become effective as of [____________________________], and shall continue until terminated as of the end of any calendar year by either party giving to the other at least 60 days written notice of its intention so to terminate. IN WITNESS WHEREOF, the parties hereto have caused this Service Agreement to be executed as of the ____ day of ________, (year). ENTERGY SERVICES, LLC
