3. Providing Local Balancing Authority, meter data management, and meter data quality services;
4. Arranging for non-nuclear fuel supplies;
5. Technical support for generation resource procurement;
6. Real-time operations for [Client Company]’s generation fleet, and operating plans, including planned and maintenance outages for [Client Company]’s generation fleet;
7. Buying and selling capacity and energy on behalf of [Client Company], including providing administration services for contractual arrangements, and power supply accounting and settlements for power and energy;
8. Representing [Client Company] in industry and stakeholder committees;
9. Performing regulatory, compliance, and litigation support services in connection with the services provided under the Service Agreement; and
10. Performing such other and different services as [Client Company] may request in support of its generation planning, operational support, dispatch, and purchased power procurement activities.
